passDatas.frag:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
uniform sampler2D iPass0;
uniform sampler2D iPass1;
//header-end
varying vec2 fUV;

#define VIG_REDUCTION_POWER 5.5
#define VIG_BOOST 4.1

float noise = 0.032;

float random(vec3 scale,float seed){return fract(sin(dot(gl_FragCoord.xyz+seed,scale))*43758.5453+seed);}

void main() {

	vec3 color = vec3( 34. / 255. );
	vec2 center = iResolution * 0.5;
	float vignette = distance( center, gl_FragCoord.xy ) / iResolution.x;
	vignette = VIG_BOOST - vignette * VIG_REDUCTION_POWER;

	float n = noise * ( .5 - random( vec3( 1. ), length( gl_FragCoord ) ) );

	gl_FragColor = vec4( color * vec3( vignette ) + vec3( n ), 1. );

}

