materials.vertexShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
uniform sampler2D iPass0;
uniform sampler2D iPass1;
//header-end
//to use normal map, you need to indicate the tangent attribute first.
attribute vec4 tangent;
varying vec2 vUv;
varying vec3 vTangent;
varying vec3 vBinormal;
varying vec3 vNormal;
varying vec3 vEye;
varying vec3 vU;
varying vec2 vN;

void main() {
    vU = normalize( vec3( modelViewMatrix * vec4( position, 1.0 ) ) );
    vN = vec2(0.0,0.0);
	vUv = uv;
	gl_Position = projectionMatrix * modelViewMatrix * vec4( position, 1.0 );
	vNormal = normalize( normalMatrix * normal );
    vTangent = normalize( normalMatrix * tangent.xyz );
    vBinormal = normalize( cross( vNormal, vTangent ) * tangent.w );
    vEye = ( modelViewMatrix * vec4( position, 1.0 ) ).xyz;
}

materials.fragmentShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
uniform sampler2D iPass0;
uniform sampler2D iPass1;
//header-end
varying vec2 vUv;
varying vec3 vTangent;
varying vec3 vBinormal;
varying vec3 vNormal;
varying vec3 vEye;
varying vec3 vU;
varying vec2 vN;

float noise = 0.098;
float rimPower = 1.696;
float normalScale = 2.;
float normalRepeat = 3.;

float random(vec3 scale,float seed){return fract(sin(dot(gl_FragCoord.xyz+seed,scale))*43758.5453+seed);}

void main() {
    vec3 finalNormal = vNormal;
	vec2 calculatedNormal = vN;
    vec3 normalTex = texture2D( iTexture1, vUv * normalRepeat ).xyz * 2.0 - 1.0;
    normalTex.xy *= normalScale;
    normalTex.y *= -1.;
    normalTex = normalize( normalTex );
    mat3 tsb = mat3( normalize( vTangent ), normalize( vBinormal ), normalize( vNormal ) );
    finalNormal = tsb * normalTex;
    vec3 r = reflect( vU, normalize( finalNormal ) );
    float m = 2.0 * sqrt( r.x * r.x + r.y * r.y + ( r.z + 1.0 ) * ( r.z+1.0 ) );
    calculatedNormal = vec2( r.x / m + 0.5,  r.y / m + 0.5 );
    vec3 base = texture2D( iTexture0, calculatedNormal ).rgb;

    // rim lighting
    float f = rimPower * abs( dot( vNormal, normalize( vEye ) ) );
    f = ( 1. - smoothstep( 0.0, 1., f ) );
    base += vec3( f );

    // noise 
    base += noise * ( .5 - random( vec3( 1. ), length( gl_FragCoord ) ) );
    gl_FragColor = vec4( base, 1. );
}

